import React from "react";
import { paisPorId } from "../redux/accion";
import { useDispatch, useSelector } from "react-redux";
import { useEffect, useState } from "react";
import { Actividad } from "./Actividad.jsx";
import style from "./Detalle.module.css";
import Navbar from "../NavBar/NavBar";

export default function Detalle(props) {
  const dispatch = useDispatch();

  const elPais = useSelector((state) => state.countryId);
  useEffect(() => {
    dispatch(paisPorId(props.match.params.id));
  }, [dispatch, props.match.params.id]);
  console.log(elPais.activities, "lalalalala", elPais, "lololololo");
  return (
    <div>
      <div>
        <Navbar />
      </div>
      <div>
        <h2>{elPais.name}</h2>
        <h4>{elPais.continente}</h4>
        <h4>{elPais.id}</h4>
        <h3>{elPais.onu}</h3>
        <h3>{elPais.capital}</h3>
        <h3>{elPais.subregion}</h3>
        <h3>{elPais.area}</h3>
        <h3>{elPais.poblacion}</h3>
        <h2>Actividades:</h2>

        {elPais.activities
          ? elPais.activities.map((e) => {
              return (
                <div>
                  <h3>Nombre:{e.nombre}</h3>
                  <h4> Temporada:{e.temporada}</h4>
                  <h4> Duracion:{e.duracion}</h4>
                  <h4> Dificultad:{e.dificultad}</h4>
                </div>
              );
            })
          : "no se registran actividadess"}
      </div>
    </div>
  );
}
